import React from 'react';
import { makeStyles, Typography, Card, CardHeader, CardContent, IconButton } from '@material-ui/core';
import MoreVertIcon from '@material-ui/icons/MoreVert';

const useStyles = makeStyles((theme)=> ({
  cardStyle: {
    margin: '10px',
    boxShadow: '0px 0px 3px 0px rgba(0,0,0,0.6)',
    // backgroundColor: 'red',
  },
  cardHeaderStyle: {
    cursor: 'pointer',
  }
}));

const ListCard = () => {
  const classes = useStyles();

  const handleSelect = (e) => {
    // console.log(e)
    console.log('Selected');
  }

  return (
    <Card className={classes.cardStyle}>
      <CardHeader
        title={
          <Typography variant='h6' onClick={handleSelect} className={classes.cardHeaderStyle}>Hello</Typography>
        }
        subheader="September 14, 2016"
        action={
          <IconButton aria-label="settings">
            <MoreVertIcon />
          </IconButton>
        }
      />
      <CardContent>
        <Typography variant="body2" color="textSecondary" component="p">
          ContentTitle
        </Typography>
        <Typography variant="body2" color="textSecondary" component="p">
          This impressive paella is a perfect party dish and a fun meal to cook together with your
          guests. Add 1 cup of frozen peas along with the mussels, if you like.
        </Typography>
      </CardContent>
    </Card>
  )
}

export default ListCard;
